import React, { useState } from "react";
import styled from "styled-components";
import GenerateBox from "./GenerateBox";
import Filters from "./Filters";

export default function OriginalGeneratorPage() {
  const [itemCategoryData, setItemCategoryData] = useState(faceICD);

  let fakeICD = [
    {
      name: "Fibers and Fabrics",
      itemCategoryId: 1,
      checked: true,
    },
    {
      name: "Spices",
      itemCategoryId: 2,
      checked: true,
    },
    {
      name: "Jewelry",
      itemCategoryId: 3,
      checked: false,
    },
  ];

  return (
    <PageWrapper>
      <h1>Original GURPS Generator</h1>
      <div className="pageContent">
        <GenerateBox typeBox="Original" tables="Default" />
        <Filters
          itemCategoryCheckedData={itemCategoryData}
          itemCategoryData={itemCategoryData}
          setItemCategoryData={setItemCategoryData}
        ></Filters>
      </div>
    </PageWrapper>
  );
}

const PageWrapper = styled.nav`
  display: flex;
  flex-direction: column;

  .pageContent {
    display: flex;
    flex-direction: row;
  }
`;
